import {TextField,Box} from "@material-ui/core"
export default class CardMargens extends Component{


    render(){

        return(
            <Box sx={{border:"1px solid #c4c4c4", width:"300px", height:"600px", display:"flex", flexDirection:"column"}}>
                <TextField label="Digite a Receita Bruta"></TextField>
                <TextField label="Digite a Receita Líquida"></TextField>
                <TextField label="Digite o Lucro Bruto"></TextField>
                <TextField label="Digite a Lucro Operacional"></TextField>
                <TextField label="Digite a Lucro Líquido"></TextField>
            </Box>

        )
    }
}
